import React from 'react';
import Head from 'next/head';
import './styles/index.scss';


class Index extends React.Component {

  render() {
    return (
      <>
        <Head>
          <link rel="shortcut icon" href="../static/favicon.ico" />
        </Head>

        <section className="app">
            <p>Hello Next.js</p>
        </section>
      </>
    )
  }
}

export default Index;
